@SuppressWarnings("unchecked")
@Override
public boolean equals(Object o) {
  IntToObjectMap<T> that = (IntToObjectMap<T>)o;
  if (that.size() != this.size()) {
    return false;
  }

  IntIterator it = keyIterator();
  while (it.hasNext()) {
    int key = it.next();
    if (!that.containsKey(key)) {
      return false;
    }

    T v1 = this.get(key);
    T v2 = that.get(key);
    if ((v1 == null && v2 != null) ||
        (v1 != null && v2 == null) ||
        (!v1.equals(v2))) {
      return false;
    }
  }
  return true;
}

